def sliding_window(x, y, window):
    x_ = []
    y_ = []
    y_gan = []
    for i in range(window, x.shape[0]):
        tmp_x = x[i - window: i, :]
        tmp_y = y[i]
        tmp_y_gan = y[i - window: i + 1]
        x_.append(tmp_x)
        y_.append(tmp_y)
        y_gan.append(tmp_y_gan)
    x_ = torch.from_numpy(np.array(x_)).float()
    y_ = torch.from_numpy(np.array(y_)).float()
    y_gan = torch.from_numpy(np.array(y_gan)).float()
    return x_, y_, y_gan
class VAE(nn.Module):
    def __init__(self, config, latent_dim):
        super().__init__()

        modules = []
        for i in range(1, len(config)):#一个for循环，对config列表中的元素进行迭代。在每一次迭代中，将创建一个nn.Sequential对象，该对象包含了一个线性层（nn.Linear）和一个ReLU激活函数（nn.ReLU）。线性层的输入维度为config[i-1]，输出维度为config[i]。然后将这个Sequential对象添加到modules列表中。
            modules.append(
                nn.Sequential(
                    nn.Linear(config[i - 1], config[i]),
                    nn.ReLU()
                )
            )

        self.encoder = nn.Sequential(*modules)
        self.fc_mu = nn.Linear(config[-1], latent_dim)
        self.fc_var = nn.Linear(config[-1], latent_dim)

        modules = []
        self.decoder_input = nn.Linear(latent_dim, config[-1])

        for i in range(len(config) - 1, 1, -1):
            modules.append(
                nn.Sequential(
                    nn.Linear(config[i], config[i - 1]),
                    nn.ReLU()
                )
            )
        modules.append(
            nn.Sequential(
                nn.Linear(config[1], config[0]),
                nn.Sigmoid()
            )
        )

        self.decoder = nn.Sequential(*modules)

    def encode(self, x):
        result = self.encoder(x)
        mu = self.fc_mu(result)
        logVar = self.fc_var(result)
        return mu, logVar

    def decode(self, x):
        result = self.decoder(x)
        return result

    def reparameterize(self, mu, logVar):
        std = torch.exp(0.5 * logVar)
        eps = torch.randn_like(std)
        return eps * std + mu

    def forward(self, x):
        mu, logVar = self.encode(x)
        z = self.reparameterize(mu, logVar)
        output = self.decode(z)
        return output, z, mu, logVar
class Generator(nn.Module):
    def __init__(self, input_size):
        super().__init__()
        self.gru_1 = nn.GRU(input_size, 1024, batch_first=True)
        self.gru_2 = nn.GRU(1024, 512, batch_first=True)
        self.gru_3 = nn.GRU(512, 256, batch_first=True)
        self.linear_1 = nn.Linear(256, 128)
        self.linear_2 = nn.Linear(128, 64)
        self.linear_3 = nn.Linear(64, 15)
        self.dropout = nn.Dropout(0.2)

    def forward(self, x):
        use_cuda = 1
        device = torch.device( "cpu")
        h0 = torch.zeros(1, x.size(0), 1024).to(device)
        out_1, _ = self.gru_1(x, h0)
        out_1 = self.dropout(out_1)
        h1 = torch.zeros(1, x.size(0), 512).to(device)
        out_2, _ = self.gru_2(out_1, h1)
        out_2 = self.dropout(out_2)
        h2 = torch.zeros(1, x.size(0), 256).to(device)
        out_3, _ = self.gru_3(out_2, h2)
        out_3 = self.dropout(out_3)
        out_4 = self.linear_1(out_3[:, -1, :])
        out_5 = self.linear_2(out_4)
        out_6 = self.linear_3(out_5)
        return out_6
def compute_mmd(tensor1, tensor2, kernel='rbf', gamma=None):
    """
    Compute the Maximum Mean Discrepancy (MMD) between two tensors.

    Parameters:
        tensor1 (numpy.ndarray): First tensor.
        tensor2 (numpy.ndarray): Second tensor.
        kernel (str): Kernel function to use. Default is 'rbf' (Gaussian radial basis function).
        gamma (float): Gamma parameter for the kernel function. If None, it will be set to 1.0 / (num_features * std_deviation).

    Returns:
        float: Maximum Mean Discrepancy (MMD) between the two tensors.
    """
    # Compute the pairwise kernel matrices
    tensor1 = tensor1.detach() if tensor1.requires_grad else tensor1
    tensor2 = tensor2.detach() if tensor2.requires_grad else tensor2
    K_xx = pairwise_kernels(tensor1, metric='rbf', gamma=gamma)
    K_yy = pairwise_kernels(tensor2, metric='rbf', gamma=gamma)
    K_xy = pairwise_kernels(tensor1, tensor2, metric='rbf', gamma=gamma)

    # Compute the MMD
    mmd = np.mean(K_xx) + np.mean(K_yy) - 2 * np.mean(K_xy)

    return mmd
